import { ProjectSet } from "../DoData"
import ProjectListElement from "./ProjectListElement"

interface ProjectListProps {
    projectSet: ProjectSet
}

const ProjectList = ({ projectSet }: ProjectListProps) => {
    return <>
        {projectSet.projects.map((project) => {
            return <ProjectListElement key={project.text} project={project} />
        })}
    </>
}

export default ProjectList
